import SlDivider from '@shoelace-style/shoelace/dist/react/divider';
import SlDropdown from '@shoelace-style/shoelace/dist/react/dropdown';
import SlMenu from '@shoelace-style/shoelace/dist/react/menu';
import SlMenuItem from '@shoelace-style/shoelace/dist/react/menu-item';

export default function Dropdown({ genres }) { 
    return (
  <SlDropdown placement="top-start">
    <SlButton slot="trigger" caret  value={selectedValue} onChange={handleChange} >
      Edit
    </SlButton>
    <SlMenu>
        {genres?.length > 0 && genres.map((item) => <><SlMenuItem value={item}>{item}</SlMenuItem><SlDivider /></>)}
    </SlMenu>
  </SlDropdown>
);
}
